import React from 'react';
import { Switch, Route } from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Home from './Home/Home'

function App() {
  return (
    <Switch>
      <Route path='/' render={() => <Home />} />
    </Switch>
  );
}

export default App;
